// SignOut.js
import React from 'react';

const SignOut = () => {
  return (
    <div>
      <h2>Log In Page</h2>
      <p>Log i to access your account.</p>
      <p>Username Area</p>
      <p>Password Area</p>

      <button input="Submit">Login</button>

      <button input='Submit'>Don't have an account? Signup!</button>
    </div>
  );
};

export default SignOut;
